import { StatusBar } from 'expo-status-bar';
import React, {useEffect} from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {OrderWatcher, OrderWatcherClient} from "./_proto/orderWatcher_pb_service";
import {Request, Response} from "./_proto/orderWatcher_pb";
import {grpc} from "@improbable-eng/grpc-web";
import { ReactNativeTransport } from '@improbable-eng/grpc-web-react-native-transport';

export default function App() {

  const host = "http://localhost:7070";



  useEffect(() => {

    const customer = new Request()
    customer.setId(1)

    grpc.invoke(OrderWatcher.Subscribe, {
      request: customer,
      host: "http://localhost:7070",
      transport: ReactNativeTransport({ withCredentials: false }),
      onMessage: (message: Response) => {
        console.log("got book: ", message.toObject());
      },
      onEnd: (code: grpc.Code, msg: string | undefined, trailers: grpc.Metadata) => {
        if (code == grpc.Code.OK) {
          console.log("all ok")
        } else {
          console.log("hit an error", code, msg, trailers);
        }
      }
    })
    const req = new Request();
    req.setId(1)
    new OrderWatcherClient(host).subscribe(req).on('data', (response) => {
      console.log(response);
    });
  }, []);


  return (
    <View style={styles.container}>
      <Text>Open up App.tsx to start working on your app!</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
